import Abstract from './components/Noticias/Abstract';
import PopularCarousel from './components/Popular/popular';
import {Text, View} from 'react-native'
import './App.css';


function App() {

  return (
    <View className='App'>
        <View className='main-content'>
          <View className='Most-popular'>
          </View>
          <View className='News'>
            <Text className='Title-News'>Noticias</Text>
            
          </View>  
        </View>
    </View>
  );
}

export default App;
